import React, { Component } from 'react';
import { Pane, Heading, Button, Text } from 'evergreen-ui'
import '../styles/styles.scss'

class Index extends Component {

  render() {
    return (
      <Pane id="App">
      <Pane display="flex" height={120} alignItems="center" justifyContent="center">
        <Heading size={700}>COVID-19 "How To" Tracker</Heading>
      </Pane>
      <Pane display="flex" padding={16} background="tint2" borderRadius={3}>
        <Pane>
          <Button marginRight={16}>Button</Button>
          <Button appearance="primary">Primary Button</Button>
        </Pane>
        </Pane>
      </Pane>
    );
  }

}

export default Index;
